            notes: "Constructs a new, empty tree set, sorted according to the\n natural\
              \ ordering of its elements.  All elements inserted into\n the set must\
              \ implement the Comparable interface.\n Furthermore, all such elements\
              \ must be mutually\n comparable: e1.compareTo(e2) must not throw a\n\
              \ ClassCastException for any elements e1 and\n e2 in the set.  If the\
              \ user attempts to add an element\n to the set that violates this constraint\
              \ (for example, the user\n attempts to add a string element to a set\
              \ whose elements are\n integers), the add call will throw a\n ClassCastException."
